"226645":{"id":"226645","name":"548 Dias: Capturada por uma Seita","slug":"548-dias-capturada-por-uma-seita","original_title":"548 días: captada por una secta","overview":"A jovem Patricia Aguilar desaparece, deixando sua família arrasada. Passam semanas angustiantes até recuperarem a esperança quando a Patricia dá sinal de vida, mas ela fala e age de forma estranha, como se fosse controlada por outra pessoa. E eles logo descobrem que ela foi ao Peru, seduzida pelo guru de uma seita, e começam a lutar para trazê-la de volta, apesar da resistência de Patricia. Do ponto de vista dos protagonistas, esta é a história de uma família superando uma tragédia.","first_air_date":"2023-06-30","episode_run_time":52,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":3,"created_by":["José F. Ortuño","Olmo Figueredo"],"production_companies":["La Claqueta"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/gDPqbmCGSSZKFShYTM2YNvD7q5e.jpg","poster_path":"https://image.tmdb.org/t/p/original/vcZsUXuQgRTFXuoBFOezU9YljyP.jpg","cast":["Patricia Aguilar"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vcZsUXuQgRTFXuoBFOezU9YljyP.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vcZsUXuQgRTFXuoBFOezU9YljyP.jpg","air_date":"2023-06-30","episode_count":3,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Fuga","overview":"Em janeiro de 2017, Patricia Aguilar, de 18 anos, sai de casa. Sua família logo percebe que ela foi capturada por um guru que a convenceu pela internet a fugir para o Peru e se juntar à seita formada por ele e suas outras esposas. A partir daquele momento, sua família começa uma campanha nas redes sociais tanto na Espanha quanto no Peru e não vai parar enquanto não recuperar sua filha, mesmo quando a própria Patricia os renega tanto em particular quanto publicamente.","air_date":"2023-06-30","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/fhzuSKVNN2kFZR1oqHoLTbUQpAB.jpg","vote_average":0},"2":{"name":"A Viagem","overview":"Após ser rejeitada pela filha, a família da Patricia Aguilar não desiste de recuperá-la. Por ela ser adulta, a polícia espanhola não pode fazer nada, o que força a família a agir. Alberto, pai de Patricia, faz uma promessa à esposa: ele vai ao Peru e não vai voltar sem encontrar a filha. Enquanto isso, Patricia começa a perceber que as promessas do guru não correspondem à realidade da seita.","air_date":"2023-06-30","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/54tC0FOMqHJVwHRkiQZEHJz80Mo.jpg","vote_average":0},"3":{"name":"O Resgate","overview":"Em solo peruano, o pai da Patricia trabalha com o cônsul espanhol para reativar o caso com o departamento de tráfico humano. Depois de reativado, a polícia peruana trabalha com a família da Patricia e a de outra seguidora e começa uma investigação que os levará a uma missão de resgate perigosa na selva amazônica. Enquanto isso, a vida na seita vira um inferno pra Patricia, que está vivendo em condições subumanas.","air_date":"2023-06-30","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/a0bvVmkCHVNq70zg5qjj2g1O4OG.jpg","vote_average":0}}}}},
