"139401":{"id":"139401","name":"Saindo do Armário com Colton Underwood","slug":"saindo-do-armario-com-colton-underwood","original_title":"Coming Out Colton","overview":"O ex-jogador da NFL e estrela de \"Bachelor\", Colton Underwood embarca na jornada para abraçar sua nova vida como membro da comunidade LGBTQ.","first_air_date":"2021-12-03","episode_run_time":36,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Jeff Jenkins Productions"],"genres":["Reality"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/ecclMevvQT3hHyIRLxWHOpz85et.jpg","poster_path":"https://image.tmdb.org/t/p/original/gnbMMccZKioIVZPEnuhglnNKc6w.jpg","cast":["Colton Underwood"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/gnbMMccZKioIVZPEnuhglnNKc6w.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gnbMMccZKioIVZPEnuhglnNKc6w.jpg","air_date":"2021-12-03","episode_count":6,"overview":"N/A","vote_average":7.5,"episodes":{"1":{"name":"Family","overview":"O próximo capítulo da vida de Colton começa quando ele se abre com a mãe e planeja outras conversas. O amigo e atleta olímpico Gus Kenworthy oferece seu conselho.","air_date":"2021-12-03","runtime":30,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":8},"2":{"name":"Football","overview":"Colton se prepara para conversar com seu técnico do colégio, e os ex-jogadores da NFL Michael Sam, David Kopay e Esera Tuaolo contam sua história como atletas gays.","air_date":"2021-12-03","runtime":37,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"3":{"name":"Friends","overview":"Em Nashville, Colton passa um tempo com o radialista country Cody Alan, mas a pressão para se enturmar em uma festa pode ser um pouco demais.","air_date":"2021-12-03","runtime":32,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"4":{"name":"Church","overview":"Colton pensa na sua relação com Deus, se abre para seus irmãos de fé e restabelece o vínculo com os membros da Igreja da Comunidade Metropolitana.","air_date":"2021-12-03","runtime":35,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":8},"5":{"name":"The Public","overview":"Depois de várias conversas em particular, Colton decide se assumir na TV. Em Nova York, ele visita o histórico Stonewall Inn com o pai e Gus.","air_date":"2021-12-03","runtime":32,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"6":{"name":"The Past & The Future","overview":"Críticas duras obrigam Colton a relembrar algumas escolhas do passado. Ele busca a ajuda de amigos e mentores para trilhar seu caminho de agora em diante.","air_date":"2021-12-03","runtime":31,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":8}}}}},
