"92732":{"id":"92732","name":"Os Casamenteiros de Joseon","slug":"os-casamenteiros-de-joseon","original_title":"조선혼담공작소 꽃파당","overview":"Lee Soo é o Princípe Herdeiro de Joseon que foi deixado sob os cuidados do Comandante da Guarda Real pelo falecido rei numa tentativa de protegê-lo daqueles que cobiçavam o trono. Criado como um ferreiro plebeu, ele vê sua vida virar de cabeça para baixo quando é literalmente arrancado de seu casamento com Gae Ddong e coroado Rei. Nada disposto a desistir de seu amor por Gae Ddong, e sabendo que, como seu novo status, casar com ela é praticamente impossível, Soo contrata a melhor equipe de casamenteiros de Joseon para transformar sua amada em uma mulher nobre e convencer o país de que ela é perfeita para o cargo de rainha. A agência contratada por ele é composta pelos três caras mais bonitos do reino: Ma Hoon, Do Joon e Ko Young Soo, conhecidos como as \"Flores\" de Joseon e que, segundo todo e qualquer um no reino, pode encontrar o par perfeito de qualquer pessoa.","first_air_date":"2019-09-16","episode_run_time":70,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Kim Yi Rang"],"production_companies":["Blossom Story","JP E&M","SLL"],"genres":["Comédia","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/qx3n3mjHt0e9IP7z3haF7jQZ7m5.jpg","poster_path":"https://image.tmdb.org/t/p/original/hHKfH3F3noU6lf4Mn7WccCNLNWp.jpg","cast":["김민재","공승연","Seo Ji-hoon","박지훈","변우석"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/dlAh5B008w1mHlFg4Ndq9UlGLdD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dlAh5B008w1mHlFg4Ndq9UlGLdD.jpg","air_date":"2019-09-16","episode_count":16,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Precisando de dinheiro, Gaettong concorda em se passar por uma nobre. Lee Su implora à melhor agência matrimonial de Joseon que o aceite como cliente.","air_date":"2019-09-16","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/bkvG31tAIr2mDXCN6JVrB8Cqihm.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Su desaparece no dia do casamento, mas Gaettong se recusa a acreditar que ele fugiu. A agência quer contratar uma casamenteira.","air_date":"2019-09-17","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/jdgw7cbpDHOcSplWgUHngahuX22.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Mesmo discordando de Gaettong, Ma Hun aceita a jovem na Agência Amor-Perfeito. Su escapa do palácio, mas a fuga dura pouco.","air_date":"2019-09-23","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/kS6x2WCobuEr0Hidmr3cKgZLrDo.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Gaettong tem três dias para convencer um aristocrata a se casar com a mulher que ama. Hun recebe um visitante indesejado na agência.","air_date":"2019-09-24","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/6Dm2jOx1wjzsDPJcwdrz3U8WUw9.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Em busca de informações sobre Kang Ji-hwa, a equipe envia Gaettong para uma casa de chá fingindo ser a filha de um nobre.","air_date":"2019-09-30","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/5loLCmNI0UZGEJNWcMAMs5w6V3l.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"O casamento do aristocrata traz problemas para a equipe. Su arma uma cena com a ajuda de uma empregada do palácio.","air_date":"2019-10-01","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/y4LuUPkvtgIkfXDuMd8g0PHRDoI.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Gaettong reencontra o irmão, mas Ji-hwa atrapalha a reunião. A agência aceita uma nova a cliente: a cunhada de Hun.","air_date":"2019-10-07","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/aQUiYJnAN2EPDZD9rmkdi901mw3.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Su se recusa a desistir de Gaettong. Isso desanima Hun, que também precisa lidar com a insistência da jovem em virar uma nobre.","air_date":"2019-10-08","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/zCJOfM4OOHCFtFg7ACYX1flZglF.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"A transformação de Gaettong começa, mas ela vai precisar trabalhar duro para conseguir passar por uma dama da nobreza. Hun descobre as verdadeiras intenções da cunhada.","air_date":"2019-10-14","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/i9nxX5vIGuUFfSalq75lrcYb6CG.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"O treinamento de Gaettong continua. Do Jun faz uma descoberta arrasadora sobre sua mãe. Ji-hwa insiste em conhecer Su.","air_date":"2019-10-15","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/mi6dakntYmygyz4Bp14nuapv9Ju.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"A busca por uma rainha ganha força, mas Su se agarra ao seu amor por Gaettong. Já o coração da garota parece bater por outro alguém. Jun engana Ji-hwa.","air_date":"2019-10-21","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/7tOSFXgmGKt3Sspybc6quyAdVdl.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Gaettong se prepara para resgatar o irmão e tem um dura notícia para Su. A identidade de Ko Yeong-su é revelada.","air_date":"2019-10-22","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/bCu0q6gFCaOVl8z3VybGmXtICAZ.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"Gaettong é forçada a participar da cerimônia de escolha da rainha. Hun faz um pedido importante. Yeong-su pondera sobre uma escolha difícil.","air_date":"2019-10-28","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/kLZguzI7nNjt49YKdGjD1wYJARf.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"Gaettong cumpre sua missão, mas sua felicidade dura pouco. O processo de seleção da rainha continua. Yeong-su relembra seu passado sombrio.","air_date":"2019-10-29","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/svZ2HEvi86TiZF0NBJ3nICaBKa2.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"Hun visita o palácio como consultor de casamento. Por pouco Gaettong não é desmascarada. Ma Bong-deok percebe que não pode mais controlar Su.","air_date":"2019-11-04","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/nGdRvllcr6EThwfyySeetVr9R6F.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"Su enfrenta um conspiração para tirá-lo do trono. Gaettong e Yeong-su são sequestrados. Hum implora para que Bong-deok abandone seus planos sombrios.","air_date":"2019-11-05","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/wXTlgPqJgAocqvRYg4xE8KwjfEX.jpg","vote_average":0}}}}},
